$(function () {
    $("#questionDialog").dialog({
        autoOpen: false,
        width: 575,
        modal: true,
        title: 'Submit a Question',
        resizable: false,
        draggable: false
    });

    function updateTopics() {
        if ($('#topic').length > 0) {
            selected = $('#topic option:selected').val();
            name     = $('#topic option:selected').attr('label');
            if ($('#selectedTopic [rel = \"'+selected+'\"] ').length == 0 && selected != '') {
                li = $('<li/>').html(name).attr('rel', selected);
                $('#selectedTopic').html('');
                $('#selectedTopic').append(li);
                li.click(function(){
                    toRemove =  $(this).attr('rel');
                    $(this).remove();
                    $('#topic [value = \"'+toRemove+'\"]').attr('selected',false);
                });
            }
        }
    }

    var SubQ = {

        bindPreview: function() {
            $('#previewQuestionForm').ajaxify('#questionDialog', {
                'bind': 'submit',
                postResponse: function() {
                    SubQ.bindSave();
                }
            });

            // Must send the data back to the submit form when editing
            $('#editQuestionButton').ajaxify('#questionDialog', {
                'bind': 'click',
                'source' : '/question/submit',
                'data' : getEditData(),
                postResponse: function() {
                    SubQ.bindEdit();
                    updateTopics();
                }
            });

            function getEditData() {
                var data = {
                    'editQuestion[topicName]': $('#topicName').val(),
                    'editQuestion[topic]': $('#topicUuid').val(),
                    'editQuestion[topicUuid]': $('#topicUuid').val(),
                    'editQuestion[question]': $('#question').val(),
                    'editQuestion[userUuid]': $('#userUuid').val(),
                    'editQuestion[askedOnBehalfOf]': $('#askedOnBehalfOf').val()
                };

                return data;
            }
        }, 

        // If the edit button is hit we want to send back to the edit form
        bindEdit: function() {
            $('#newQuestionForm').ajaxify('#questionDialog', {
                'bind' : 'submit',
                postResponse: function() {
                    SubQ.bindPreview();
                    SubQ.bindEdit();
                    updateTopics();
                }
            });
            SubQ.setupQ();
        },

        bindSave: function() {
            $('#previewQuestionForm').ajaxify('#questionDialog', {
                'bind': 'submit',
                postResponse: function() {
                    SubQ.bindPost();
                }
            });
        },

        bindPost: function() {
            $('#postQuestionForm').ajaxify('#questionDialog', {
                'bind': 'submit',
                postResponse: function() {
                    $('#questionDialog').dialog('close');
                }
            });
        },

        setupQ: function() {
            $('#topicSelector :first-child').attr('selected', true);

            $('#selectedTopic').show();
            $('#topic').hide();

            var removeTopic = function () {
                selected =  $(this).attr('rel');
                $(this).remove();
                $('#topic [value = \"'+selected+'\"]').attr('selected',false);
            };

            function updateSelected (key, item) {
                item = $(item);
                selected = item.val();
                name = item.html();
                if ($('#selectedTopic [rel = \"'+selected+'\"] ').length == 0 && selected != '') {
                    li = $('<li/>').html(name).attr('rel', selected);
                    $('#selectedTopic').html('');
                    $('#selectedTopic').append(li);
                    li.click(removeTopic);
               }
            }

            $('#selectedTopic li').click(removeTopic);

            $('#topicSelector').change(function () {
                updateSelected(0,$(':selected',this));
                selected = $(this).val();
                name = $(':selected',this).html();
                $('#topic [value = \"'+selected+'\"]').attr('selected',true);
                $('#topicSelector :first-child').attr('selected', true);
            });
        }
    }
});
